import React from 'react';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import './App.css';

function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Switch>
        <Route path="/">
          </Route>
        <Route path="/About">
        </Route>
        </Switch>
     </Router>
    </>
  );
}

function About() {
  return <h1>About</h1>
}

export default App;
